import React, {Component} from "react";
import Card from './CardUI';

import ACimg1 from '../image-asset/Camping.jpg'
import ACimg2 from '../image-asset/best-travel-agancy-in-sri-lanka-home-2-or-4.jpg'
import ACimg3 from '../image-asset/image_processing20181012-4-13iikyk.jpg'


class MoreCards extends Component{

    render(){
    return(
        <React.Fragment>
            <h1 className="text-capitalize text-center my-5 text-danger">POPULAR GROUPS</h1>
            <h3 className="text-capitalize text-center my-5 text-danger">UPCOMING EVENTS</h3>
        <div className= "container-fluid d-flex justify-content-center">
            <div className= "row">
                <div className= "col-md-4">
                    <Card imgsrc={ACimg1} title="Camping" date="12th Dec 2020" time="5:00-7:00 am"/>
                </div>
                <div className= "col-md-4" >
                    <Card imgsrc={ACimg2} title="Rowing" date= "20th Dec 2020" time="10:00-11:00 am"/>
                </div>
                <div className= "col-md-4">
                    <Card imgsrc={ACimg3} title="Cycling" date="30th Dec 2020" time="3:00-6:00 pm"/>
                </div>
            </div>
        </div>
        </React.Fragment>

    );
    }
}

export default MoreCards;
